// HasCreditPrioritySubAccountsWith applies the HasEdge predicate on the "credit_priority_sub_accounts" edge with a given conditions (other predicates).
func HasCreditPrioritySubAccountsWith(preds ...predicate.LedgerSubAccount) predicate.LedgerDimension {
	return predicate.LedgerDimension(func(s *sql.Selector) {
		step := newCreditPrioritySubAccountsStep()
		sqlgraph.HasNeighborsWith(s, step, func(s *sql.Selector) {
			for _, p := range preds {
				p(s)
			}
		})
	})
}

// And groups predicates with the AND operator between them.
func And(predicates ...predicate.LedgerDimension) predicate.LedgerDimension {
	return predicate.LedgerDimension(sql.AndPredicates(predicates...))
}

// Or groups predicates with the OR operator between them.
func Or(predicates ...predicate.LedgerDimension) predicate.LedgerDimension {
	return predicate.LedgerDimension(sql.OrPredicates(predicates...))
}

// Not applies the not operator on the given predicate.
func Not(p predicate.LedgerDimension) predicate.LedgerDimension {
	return predicate.LedgerDimension(sql.NotPredicates(p))
}
